import {
  Avatar,
  BottomNavigation,
  Button,
  Toolbar,
} from "@mui/material";
import React from "react";
import HomeIcon from "@mui/icons-material/Home";
import MapsUgcIcon from "@mui/icons-material/MapsUgc";
import image from "../assets/akash.jpg";
import { Favorite } from "@mui/icons-material";

const Footer = () => {
  return (
    <BootomNav position="fixed" sx={{backgroundColor:'black',p:0,m:0}}>
                <Toolbar>

      <Button sx={{color:"white"}}>{<HomeIcon fontSize="large" />}</Button>
      <Button sx={{ml:5,color:"white"}}  >{<MapsUgcIcon fontSize="large"  />}</Button>
      <Button sx={{ml:5,color:"white"}} color="inherit">{<Favorite fontSize="large" />}</Button>

      <Button sx={{ml:5}} color="inherit">
        {" "}
        <Avatar alt="Remy Sharp" sx={{ width: 35, height: 35 }} src={image} />
      </Button>
      </Toolbar>


    </BootomNav>
  );
};

export default Footer;
